window.bookSummaryJSON = "<p><b>[Last time in Multiverse Z!] A Shadow Prince saved a War Princess from death and achieved his vengeance on an old nemesis!</b></p> <p>Joey Eclipse is the #1 beginner with a list of achievements that's hard to believe. All while in an apocalypse where the multiverse integrates whole universes and initiates countless humans to its game-like realms of limitless magic.</p> <p>Here's the problem. He's way too overpowered to stay in a lesser realm. And he keeps refusing his first ascension to accomplish his remaining goals:</p> <p>1. Learn a magical crafting ability to turn his growing hoard of loot into deadlier weapons.</p> <p>2. Train with his Renegades and improve his powers over shadow, necromancy, dragon magic, and the cultivation of fate.</p> <p>3. The War Princess warrior, Maylolee Suzuki.</p> <p>Too bad Joey's refusal to ascend dooms the lesser realm to suffer attacks from buffed-up monsters. Like the epic dread whale, a highly evil boss that's two realms of power greater than Joey Eclipse.</p> <p>If Joey makes any crucial mistakes, his enemies will make him pay dearly. If he succeeds, his ascension won't be great alone. It might go rogue with someone special at his side.</p> <p>Follow Joey in another quick and meaty action-adventure book that's perfect for fans of <i>He Who Fights With Monsters</i>, <i>Cradle</i>, and <i>The Primal Hunter</i>. Dive into an apocalypse isekai with a strong progression LitRPG, a cultivation system, and a dynamic romance between two overpowered battle freaks going on grand adventures across the multiverse.</p> <p>[Welcome back to Multiverse Z!]</p> <p>[Now let's continue with the season one finale.]</p>"; 
